import React, {Component} from "react"

import './css/Faces.css';

class VideoCard extends Component {
  constructor(props){
    super(props)
  }

  render(){
    return(
      <div style={{margin:"auto", textAlign:"center", width:"70vw"}}>
        <p className="video-title">
          {this.props.title}
        </p>
        <iframe style={{width:"70vw", height:"600px"}}
          src={this.props.link}>
        </iframe>
        <p className="video-caption">
          {this.props.caption}
        </p>
      </div>
    )
  }
}

class VideoCarousel extends Component{
  constructor(props){
    super(props);

    this.state = {
      index: 0,
      links: ["https://www.youtube.com/embed/tgbNymZ7vqY",
              "https://www.youtube.com/embed/tgbNymZ7vqY"],
      titles: ["title1",
               "title2"],
      captions: ["caption1",
                 "caption2"]
    };
  }

  render(){
    return(
      <VideoCard />
    )
  }
}

class FacesComponent extends Component{
  render(){
    return(
      <div>
        <p className="text-24pt page-title">
           Faces of Austin
        </p>
        <div className="blue-yellow-bar"/>
        <p className="text-16pt centered-text" style={{textAlign:"center"}}>
           Faces of Austin is a mini documentary series put on by ACP members
           that spotlights different local businesses and the people working
           there around Austin. Check out some of our latest features!
        </p>

        <VideoCarousel />
      </div>
    )
  }
}

export default FacesComponent;
